import React from 'react';
import ArtistTrackerApi from './api';

function EventList( {data} ) {
    console.log('DATA:', data)

    return(
        <div>
            <ul>
                {data.map(d => {
                   return <li>{d.name}</li>
                })}
            </ul>
        </div>
    )
}

export default EventList;
